import React from 'react';
class App extends React.Component{
  constructor() {
    super();
    this.state = { name: "" };
  }
  render() {
    return (
      < div >
        <h1>Welcome {this.state.name}</h1>
        <label Forhtml="a">Enter Your Username:</label><input type="text" placeholder="enter ur username" onChange={this.uservalue}/>
    </div>
    )
  }
  uservalue = (event) => {
    this.setState({ name: event.target.value });
  }
}
export default App;
